import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

const PlaceOrder = () => {
    
    const history = useNavigate();

    const[order, setOrder] = useState({
        mobileNo:"",
        productName:"",
        couponCode:"",
    })
const{mobileNo,productName,couponCode} = order;

const onInputChange = (e)=>{
    setOrder({...order,[e.target.name]:e.target.value});
};


    const sumitHandler =async (e)=>{
      e.preventDefault();
      await axios.post('http://localhost:8080/placeorder',order)
                  history("/readorders");
    };
    return(
    <div>
        <Form onSubmit={(e)=>sumitHandler(e)}>
      <div className="mb-3">
        <div className="d-flex justify-content-between m-3">
        <h2>Place order </h2>
        <Link to = "/readorders">
        <Button variant="primary">Show orders</Button>
        </Link>
        </div>
        <div>
        <label>mobileNo</label>
        <input type="text" name = "mobileNo" value={mobileNo} onChange={(e)=>onInputChange(e)}/>
        </div>
        <div>
        <label>productName</label>
        <input type="text" name = "productName" value={productName} onChange={(e)=>onInputChange(e)}/>
        </div>
        <div>
        <label>couponCode</label>
        <input type="text" name = "couponCode" value={couponCode} onChange={(e)=>onInputChange(e)}/>
        </div>
        <Button type="submit">submit</Button>
        <Link to = "/readorders">
        <Button variant="primary">cancel</Button>
        </Link>
      </div>
    </Form>
      
    </div>
  )
}

export default PlaceOrder
